            <br />
            <span className={s.description}>A passionate Full Stack Software Developer ðŸš€ having an <br /> <span >experience of building Web and Mobile applications with </span>JavaScript / Reactjs / Nodejs / React Native and some other cool libraries and frameworks.</span>
        </div>
    );
}

export default Home;
